import React from 'react';
import Skills from "./Skills";
import NavigationBar from "./NavigationBar";
import Footer from "./Footer";

import './style/App.css';

class SkillPage extends React.Component {
    render() {
        return (
          <div className="global">
              <NavigationBar/>
              <Skills/>
              <div>
                  Languages:	C, SQL, Java, Python, Shell Script, Javascript, Eiffel, Assembly, Verilog, HTML5, CSS <br />
                  Platforms:	Linux, Windows (Desktop and Mobile), Android, iOS <br />
                  Applications:	MS Office (Word, Excel, PowerPoint, Outlook), MS Visio <br />
                  Development Tools:	Git, Eclipse, React JS, NodeJS, Webpack, MongoDB, Redux, Express and ES6
                  Other:	SPIM

              </div>
              <Footer/>
          </div>
        );
    }
}

export default SkillPage;
